bits.text:
Stiti videourile alea motivationale cu You can Do It! Nu te plafona. Fii cea mai buna versiune a ta! Do it! Reclame de genul: cum sa citești o carte fara sa o citești, si ia cartea si incepe sa își dea cu ea in cap si sa murmure mmmm Mindvalley Academy. Unii suntem Samsung J5, altii sunt Galaxy Note S. Aia e. E nevoie de toti oricum. Ce-ar fi daca nimeni nu ar mai face nimic, toti ar astepta sa fie presedinti, regi, miliardari. "Salut, da-mi si mie te rog un capucino cu lapte?" "Aaa,nu dute-n pula mea, cea mai buna versiune a mea nu face capucino la saraci!"
Când o sa fiu bătrân cu nepoți care o sa ma întrebe "Bunicule de ce nu ai făcut nimic cu viata ta?" Pentru ca m-am uitat la video-ul ala cu cea mai bună versiune a ta și am zis că eu merit, așa că m-am apucat de băut și mi-am distrus viața. O sa știu sa le raspund. De la stomac dragii moșului.
Ținta e prea sus. Când eram mai mic voiam sa câștig oscarul, ca îmi plăcea ce se intampla la gala. Ce prost eram. Și acum vreau sa câștig oscarul. Îmi amintesc ca stăteam și probabil ma masturbam pe la vreo 12 ani la vreo lustra deaia batraneasca de sticla care avea corpul unei femei și ma gandeam ca sunt la festivitatea de decernare a oscarurilor. Am luat Oscar pentru multe filme eu. {Continuare}
